/* Constants */
#define GRAVITY 9.81
#define BASKETBALL_RADIUS 20
#define X_DIM 320
#define Y_DIM 240

/* VGA Display Parameters */
volatile int pixel_buffer_start;
short int Buffer1[240][512];
short int Buffer2[240][512];
volatile int *pixel_ctrl_ptr = (int *)0xFF203020;

/* PS2 Parameters */
volatile int *PS2_ptr = (int *)0xFF200100;
unsigned char byte1 = 0, byte2 = 0, byte3 = 0;

/* Image Arrays */
const unsigned short basketblitz[];

/* Structs */
typedef struct {
    int x;
    int y;
} Position;

typedef struct {
    int x;
    int y;
} Velocity;

typedef struct {
    int score;
    char name[10];  // 10 characters max name
} Player;

typedef struct {
    Position initialPos;
    Position currentPos;
    float startingAngle;
    Velocity initialVel;
    Velocity currentVel;
    bool isMoving;
    Player owner;
} Basketball;

typedef enum {
    INITIALIZING,
    PLAYING,
    GAME_OVER,
    NONE
} GameState;

typedef struct {
    Player currentTurn;
    Basketball currentBall;
    Player player1;
    Player player2;
    int currentTime;
    int maxTime;
    int currentRound;
    int maxRounds;
    bool isGameOver;
    GameState currentState;
    GameState previousState;
} Game;

enum Control {
    SPACEBAR = 0x29,
    ESC = 0x76,
    W = 0x1D,
    A = 0x1C,
    S = 0x1B,
    D = 0x23,
    UP = 0x75,
    DOWN = 0x72,
    LEFT = 0x6B,
    RIGHT = 0x74,
};

/* PS2 Functions Prototypes */
void read_keyboard(unsigned char *byte1, unsigned char *byte2, unsigned char *byte3);
void clearKeyboardBuffer();

/* VGA Graphics Functions Prototypes */
void plot_pixel(int x, int y, short int color);
void clear_screen();
void wait_for_vsync();

void draw_image(const unsigned short image[], Position pos, int width, int height);
void draw_basketball(Basketball *ball, short int color, bool fill);
void draw_box(int x, int y, short int color);

/* Game Logic Functions Prototypes */
void initializeGame(Game *game);
void updateBasketball(Basketball *ball, int deltaTime);
void updateGame(Game *game, int deltaTime);

/* FSM Functions Prototypes */
void updateState(Game *game, unsigned char pressedKey);


int main(void) {
    /* set front pixel buffer to Buffer 1 */
    *(pixel_ctrl_ptr + 1) = (int)&Buffer1;  // first store the address in the  back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen();  // pixel_buffer_start points to the pixel buffer

    /* set back pixel buffer to Buffer 2 */
    *(pixel_ctrl_ptr + 1) = (int)&Buffer2;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // we draw on the back buffer
    clear_screen();                              // pixel_buffer_start points to the pixel buffer

    // Initialize the game
    Game game;
    initializeGame(&game);

    // Initialize the PS2
    unsigned char pressedKey = 0;
    *(PS2_ptr) = 0xFF;  // reset the PS/2 port
    clearKeyboardBuffer();

    // Main game loop
    while (1) {
        // Read the keyboard
        read_keyboard(&byte1, &byte2, &byte3);
        pressedKey = byte3;

        // Update the game state
        updateState(&game, pressedKey);

        wait_for_vsync();                            // Swap buffers
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // Back buffer
    }

    // Initialize the VGA display
    return 0;
}

/* -------------------------------------------------------------------------- */
/*                                 FSM                                        */
/* -------------------------------------------------------------------------- */

// Update the game state based on the current state and set initial screen for each state
void updateState(Game *game, unsigned char pressedKey) {
    
    game->previousState = game->currentState; // Save the previous state
    clear_screen(); // Clear the screen
    
    switch (game->currentState) {
        
        case INITIALIZING:

            printf("Game initialized\n");  

            draw_image(basketblitz, (Position){0, 0}, 320, 240);

            // Transition to the playing state when the spacebar is pressed
            if (pressedKey == SPACEBAR) {
                game->currentState = PLAYING;
            }

            break;

        case PLAYING:

            printf("Game playing\n");

            draw_basketball(&game->currentBall, 0xFFFF, true);

            // Transition to the game over state when the game is over
            if (pressedKey == ESC || game->currentTime >= game->maxTime || game->currentRound >= game->maxRounds) {
                game->currentState = GAME_OVER;
            
            } else if (pressedKey == W) {
                game->currentBall.currentPos.y += 5;
            }
            else if (pressedKey == S) {
                game->currentBall.currentPos.y -= 5;
            }
            else if (pressedKey == A) {
                game->currentBall.currentPos.x -= 5;
            }
            else if (pressedKey == D) {
                game->currentBall.currentPos.x += 5;
            }

            updateGame(game, 0); // one second passes between each cycle, need to add timer

            break;

        case GAME_OVER:

            printf("Game over\n");

            draw_box(100, 100, 0xFFFF);

            // Transition to the initializing state when the spacebar is pressed
            if (pressedKey == ESC) {
                game->previousState = GAME_OVER;
                game->currentState = INITIALIZING;
                // Reset the game
                initializeGame(game);
            }

            break;
    }
    clearKeyboardBuffer(); // Prevents the game from registering multiple key presses and overflowing the buffer
}

/* -------------------------------------------------------------------------- */
/*                              PS2 subroutines                               */
/* -------------------------------------------------------------------------- */

void read_keyboard(unsigned char *byte1, unsigned char *byte2, unsigned char *byte3) {
    int PS2_data, RVALID;

    // PS/2 mouse needs to be reset (must be already plugged in)
    PS2_data = *(PS2_ptr);       // read the Data register in the PS/2 port
    RVALID = PS2_data & 0x8000;  // extract the RVALID field
    if (RVALID) {
        /* shift the next data byte into the display */
        *byte1 = *byte2;
        *byte2 = *byte3;
        *byte3 = PS2_data & 0xFF;
        // HEX_PS2(byte1, byte2, byte3);
        if ((*byte2 == (char)0xAA) && (*byte3 == (char)0x00))
            // mouse inserted; initialize sending of data
            *(PS2_ptr) = 0xF4;
    }
}

void clearKeyboardBuffer() {
    byte1 = 0;
    byte2 = 0;
    byte3 = 0;
}

/* -------------------------------------------------------------------------- */
/*                       VGA Graphics subroutines                             */
/* -------------------------------------------------------------------------- */

void plot_pixel(int x, int y, short int color) {
    volatile short int *one_pixel_address;
    one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
    *one_pixel_address = color;
}

void clear_screen() {
    int x, y;
    for (x = 0; x < 320; x++)
        for (y = 0; y < 240; y++)
            plot_pixel(x, y, 0x0000);  // clear pixel at (x, y)
}

void wait_for_vsync() {
    {
        int status;
        *pixel_ctrl_ptr = 1;  // start the synchronization process
        // - write 1 into front buffer address register
        status = *(pixel_ctrl_ptr + 3);  // read the status register
        while ((status & 0x01) != 0)     // polling loop waiting for S bit to go to 0
        {
            status = *(pixel_ctrl_ptr + 3);
        }
    }
}

void draw_basketball(Basketball *ball, short int color, bool fill) {
    int x0 = ball->currentPos.x;
    int y0 = ball->currentPos.y;

    int radius = BASKETBALL_RADIUS;

    // center of ball is its position

    for (int x = -radius; x <= radius; x++) {
        int y1 = y0 + sqrt(radius * radius - x * x);
        int y2 = y0 - sqrt(radius * radius - x * x);

        plot_pixel(x0 + x, y0 + y1, color);
        plot_pixel(x0 + x, y0 + y2, color);
        // Draw horizontal lines between the upper and lower halves of the circle
        if (fill) {
            for (int y = y2 + 1; y < y1; y++) {
                plot_pixel(x0 + x, y, color);
            }
        }
    }
}

void draw_image(const unsigned short image[], Position pos, int width, int height) {
    int x, y;
    for (x = 0; x < width; x++) {
        for (y = 0; y < height; y++) {
            plot_pixel(x + pos.x, y + pos.y, image[y * 320 + x]);
        }
    }
}

